#if 0
gdouble afmm_binomial(guint n, guint k)
/* https://stackoverflow.com/questions/9619743/how-to-calculate-binomial-coefficents-for-large-numbers */
{
  if (k > n) return 0 ;

  gdouble c = n;
  for ( guint i = 1; i < k; i ++ ) {
    c *= n - i ;
    c /= i + 1 ;
  }

  return c;
}
#endif

